import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';
import { clearAuth } from '../auth/AuthUtils';

const HomePage = () => {
  // Clear authentication when visiting homepage
  useEffect(() => {
    clearAuth();
  }, []);

  return (
    <div className="homepage">
      <header className="homepage-header">
        <div className="container">
          <nav className="main-nav">
            <div className="logo">
              <span>Sunny</span>
            </div>
            <div className="nav-links">
              <Link to="/features">Features</Link>
              <Link to="/pricing">Pricing</Link>
              <Link to="/docs">Documentation</Link>
              <Link to="/about">About</Link>
            </div>
            <div className="auth-links">
              <Link to="/login" className="login-link">Log in</Link>
              <Link to="/signup" className="signup-link">Sign up</Link>
            </div>
          </nav>
        </div>
      </header>

      <section className="hero-section">
        <div className="container">
          <div className="hero-content">
            <h1>Modern payment infrastructure for the internet</h1>
            <p>Sunny provides APIs and tools that make it easy to integrate payments into your website or mobile app.</p>
            <div className="hero-buttons">
              <Link to="/signup" className="btn btn-primary">Get started</Link>
              <Link to="/docs" className="btn btn-secondary">Read the docs</Link>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
